import React from "react";
import "./style.css";

function TitleBox () {
    return (
            <div id="text-box">
                <h2>Botanical image library</h2>
                <h1>Truffle</h1> 

                {/* <img src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/img/beech_leaf.png" alt="beech-leaf" /> */}
            </div>
    );
}

export default TitleBox;
